                    yield return new object[] { PopulateException(forestTrustCollisionException), new TypeSerializableValue[] { new TypeSerializableValue("", TargetFrameworkMoniker.netcoreapp20), new TypeSerializableValue("", TargetFrameworkMoniker.netfx461) } };

                    var syncFromAllServersOperationException = new SyncFromAllServersOperationException("message", exception);
                    yield return new object[] { PopulateException(syncFromAllServersOperationException), new TypeSerializableValue[] { new TypeSerializableValue("", TargetFrameworkMoniker.netcoreapp20), new TypeSerializableValue("", TargetFrameworkMoniker.netfx461) } };
                }
            }

            // TODO: Inbox framework assemblies with same identity aren't currently used for running tests. https://github.com/dotnet/corefx/issues/24903
            if (!PlatformDetection.IsFullFramework)
            {
                var compositionContractMismatchException = new CompositionContractMismatchException("message", exception);
                yield return new object[] { PopulateException(compositionContractMismatchException), new TypeSerializableValue[] { new TypeSerializableValue("", TargetFrameworkMoniker.netcoreapp20), new TypeSerializableValue("", TargetFrameworkMoniker.netfx461) } };

                var importCardinalityMismatchException = new ImportCardinalityMismatchException("message", exception);
                yield return new object[] { PopulateException(importCardinalityMismatchException), new TypeSerializableValue[] { new TypeSerializableValue("", TargetFrameworkMoniker.netcoreapp20), new TypeSerializableValue("", TargetFrameworkMoniker.netfx461) } };
            }

            // Extension of core serializable types
            // Disabling on full framework until we compile against net471
            if (!PlatformDetection.IsFullFramework/* ? PlatformDetection.IsNetfx471OrNewer : true*/)
            {
                // ValueType isn't serializable before net471.
                yield return new object[] { new ValueTuple(), new TypeSerializableValue[] { new TypeSerializableValue("AAEAAAD/////AQAAAAAAAAAEAQAAABFTeXN0ZW0uVmFsdWVUdXBsZQAAAAAL", TargetFrameworkMoniker.netcoreapp20), new TypeSerializableValue("AAEAAAD/////AQAAAAAAAAAEAQAAABFTeXN0ZW0uVmFsdWVUdXBsZQAAAAAL", TargetFrameworkMoniker.netfx471) } };
                yield return new object[] { ValueTuple.Create(1), new TypeSerializableValue[] { new TypeSerializableValue("AAEAAAD/////AQAAAAAAAAAEAQAAAHBTeXN0ZW0uVmFsdWVUdXBsZWAxW1tTeXN0ZW0uSW50MzIsIG1zY29ybGliLCBWZXJzaW9uPTQuMC4wLjAsIEN1bHR1cmU9bmV1dHJhbCwgUHVibGljS2V5VG9rZW49Yjc3YTVjNTYxOTM0ZTA4OV1dAQAAAAVJdGVtMQAIAQAAAAs=", TargetFrameworkMoniker.netcoreapp20), new TypeSerializableValue("AAEAAAD/////AQAAAAAAAAAEAQAAAHBTeXN0ZW0uVmFsdWVUdXBsZWAxW1tTeXN0ZW0uSW50MzIsIG1zY29ybGliLCBWZXJzaW9uPTQuMC4wLjAsIEN1bHR1cmU9bmV1dHJhbCwgUHVibGljS2V5VG9rZW49Yjc3YTVjNTYxOTM0ZTA4OV1dAQAAAAVJdGVtMQAIAQAAAAs=", TargetFrameworkMoniker.netfx471) } };
                yield return new object[] { ValueTuple.Create(1, "2"), new TypeSerializableValue[] { new TypeSerializableValue("", TargetFrameworkMoniker.netcoreapp20), new TypeSerializableValue("", TargetFrameworkMoniker.netfx471) } };
                yield return new object[] { ValueTuple.Create(1, "2", 3u), new TypeSerializableValue[] { new TypeSerializableValue("", TargetFrameworkMoniker.netcoreapp20), new TypeSerializableValue("", TargetFrameworkMoniker.netfx471) } };
                yield return new object[] { ValueTuple.Create(1, "2", 3u, 4L), new TypeSerializableValue[] { new TypeSerializableValue("", TargetFrameworkMoniker.netcoreapp20), new TypeSerializableValue("", TargetFrameworkMoniker.netfx471) } };
                yield return new object[] { ValueTuple.Create(1, "2", 3u, 4L, 5.6), new TypeSerializableValue[] { new TypeSerializableValue("", TargetFrameworkMoniker.netcoreapp20), new TypeSerializableValue("", TargetFrameworkMoniker.netfx471) } };
                yield return new object[] { ValueTuple.Create(1, "2", 3u, 4L, 5.6, 7.8f), new TypeSerializableValue[] { new TypeSerializableValue("", TargetFrameworkMoniker.netcoreapp20), new TypeSerializableValue("", TargetFrameworkMoniker.netfx471) } };
                yield return new object[] { ValueTuple.Create(1, "2", 3u, 4L, 5.6, 7.8f, 9m), new TypeSerializableValue[] { new TypeSerializableValue("", TargetFrameworkMoniker.netcoreapp20), new TypeSerializableValue("", TargetFrameworkMoniker.netfx471) } };
                yield return new object[] { ValueTuple.Create(1, "2", 3u, 4L, 5.6, 7.8f, 9m, Tuple.Create(10)), new TypeSerializableValue[] { new TypeSerializableValue("", TargetFrameworkMoniker.netcoreapp20), new TypeSerializableValue("", TargetFrameworkMoniker.netfx471) } };
            }
        }

        // *** NON AUTO UPDATED DATA ***

        private static T PopulateException<T>(T exception, bool setHResult = true)
            where T : Exception
        {
            exception.HelpLink = "http://msdn.microsoft.com";
            exception.Source = "Exception_Class_Samples";

            exception.Data.Add("secret", true);
            exception.Data.Add(1, "one");

            // Exceptions are reflection blocked in uapaot
            if (!PlatformDetection.IsNetNative)
            {
                typeof(Exception)
                    .GetField("_stackTraceString", BindingFlags.Instance | BindingFlags.NonPublic)
                    .SetValue(exception, "StackTrace string...");
                if (setHResult)
                {
                    typeof(Exception)
                        .GetField("_HResult", BindingFlags.Instance | BindingFlags.NonPublic)
                        .SetValue(exception, 1000);
                }
                typeof(Exception)
                    .GetField("_remoteStackTraceString", BindingFlags.Instance | BindingFlags.NonPublic)
                    .SetValue(exception, "Remote StackTrace string...");
            }

            return exception;
        }

        public static IEnumerable<object> NonSerializableObjects_MemberData()
        {
            yield return new NonSerializableStruct();
            yield return new NonSerializableClass();
            yield return new SerializableClassWithBadField();
            yield return new SerializableClassDerivedFromNonSerializableClass();
            yield return new object[] { 1, 2, 3, new NonSerializableClass() };
        }

        public static IEnumerable<object[]> BasicObjectsRoundtrip_MemberData()
        {
            foreach (object[] record in SerializableObjects_MemberData())
            {
                foreach (FormatterAssemblyStyle assemblyFormat in new[] { FormatterAssemblyStyle.Full, FormatterAssemblyStyle.Simple })
                {
                    foreach (TypeFilterLevel filterLevel in new[] { TypeFilterLevel.Full, TypeFilterLevel.Low })
                    {
                        foreach (FormatterTypeStyle typeFormat in new[] { FormatterTypeStyle.TypesAlways, FormatterTypeStyle.TypesWhenNeeded, FormatterTypeStyle.XsdString })
                        {
                            yield return new object[] { record[0], assemblyFormat, filterLevel, typeFormat };
                        }
                    }
                }
            }
        }

        public static IEnumerable<object[]> NonSerializableTypes_MemberData()
        {
            foreach (object obj in NonSerializableObjects_MemberData())
            {
                foreach (FormatterAssemblyStyle assemblyFormat in new[] { FormatterAssemblyStyle.Full, FormatterAssemblyStyle.Simple })
                {
                    foreach (TypeFilterLevel filterLevel in new[] { TypeFilterLevel.Full, TypeFilterLevel.Low })
                    {
                        foreach (FormatterTypeStyle typeFormat in new[] { FormatterTypeStyle.TypesAlways, FormatterTypeStyle.TypesWhenNeeded, FormatterTypeStyle.XsdString })
                        {
                            yield return new object[] { obj, assemblyFormat, filterLevel, typeFormat };
                        }
                    }
                }
            }
        }

        public static IEnumerable<object[]> FuzzInputs_MemberData()
        {
            var rand = new Random(42);
            foreach (object[] record in SerializableObjects_MemberData())
            {
                const int FuzzingsPerObject = 3;
                for (int i = 0; i < FuzzingsPerObject; i++)
                {
                    yield return new object[] { record[0], rand };
                }
            }
        }

